const Cards = ({card}) => {
    const [like,setLike]= useState(card.rating);
    const[dislike,setDislike]=useState(card.rating);

    function handleLike(){
    setLike(()=>{
       return like + 1
    })
    }
    function handleDislike(){
        setDislike(()=>{
            return dislike - 1
         })
    }

    return (
        <div  className="cards">
            <div className="card">
            <h4>{card.title}</h4>
           <iframe
            src={card.url} 
            title={card.url}
             frameborder="0" 
             allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture">
             </iframe>
             <p>{card.rating }</p>
             <div>
             <button onClick={handleLike}>Up Vote</button>
             <button onClick={handleDislike}>Down vote </button>
             </div>
             <button onC>Delete</button>
          </div>
            

            
        </div>
    );
}

export default Cards;
